import React from 'react';
import './index.css';

const myPlace = {
  name: 'Ongole',
  description: 'A beautiful and serene place to live.',
  image: 'path-to-your-image.jpg', // Replace with the actual path to your image
  link: 'https://example.com' // Replace with a relevant link, if any
};

const MyPlace = () => {
  return (
    <div className="myplace-container">
      <h2 className="myplace-title">My Place</h2>
      <div className="myplace-card">
        <img src={myPlace.image} alt={myPlace.name} className="myplace-image" />
        <h3>{myPlace.name}</h3>
        <p>{myPlace.description}</p>
        {myPlace.link && <a href={myPlace.link} target="_blank" rel="noopener noreferrer">Learn More</a>}
      </div>
    </div>
  );
};

export default MyPlace;
